import React from "react";
import { Typography, Box, Chip } from "@material-ui/core";
const Metric = ({ title, metric, variance, varianceType, subtitle }) => {
  return (
    <Box style={{ padding: "16px", borderRight: "1px solid #ccc" }}>
      <Typography
        variant="body1"
        style={{ textAlign: "left" }}
        color="text.primary"
      >
        {title}
      </Typography>

      <Typography variant="h5" style={{ textAlign: "left" }} color="primary">
        <span style={{ fontWeight: "bold", marginRight: "8px " }}>
          {metric}
        </span>
        <Chip label={variance} color={varianceType} variant="outlined" />
      </Typography>
      <Typography
        variant="body2"
        style={{ textAlign: "left" }}
        color="text.primary"
      >
        <span style={{ fontWeight: "light" }}>{subtitle}</span>
      </Typography>
    </Box>
  );
};

export default Metric;
